import { MovieSharp } from "@material-ui/icons";
import React from "react";
import "./results.css";
import VideoCard from "./VideoCard";

function Results() {
  return (
    <div className="results">
      {MovieSharp.map((movie) => (
        <VideoCard key={movie.id} movie={movie} />
      ))}
    </div>
  );
}

export default Results;
